import React from 'react';
import Header from '../components/Header';
import Body from '../components/Body';
import Footer from '../components/Footer';
import Navbar from '../components/Navbar';

const Home = () => {
    return (
        <div>
            <Navbar />
            <Header 
            headerImage='./images/header-pic2.jpg' 
            />         
            <Body 
                img="./images/doctor2.png" 
                title="Your onestop non-pharma distributor"
                headingPartOne="Welcome to "
                headingPartTwo="Twokay chemicals"
                content="We are a distinguished pharmaceutical distributor and wholesale chemist, embarked on its journey in 1992 and has since grown into a leading player in the healthcare industry. Guided by a mission to conduct business with a caring heart, the company is committed to providing high-quality healthcare solutions that positively impact the lives of patients and healthcare professionals alike."
            />
            <Footer />
        </div>
    )
};

export default Home;
